import React from "react";
import Gambar from "./2.jpg";

function Programming() {
  return (
    <div className="mark">
      <div className="flex items-center justify-center gap-3 p-5 pl-20">
        <div className="1 flex h-[20rem] w-[30rem]">
          <img src={Gambar} alt="" />
        </div>
        <div className="h-[20rem] w-full p-16 text-center">
          <p>
            Lorem ipsum dolor sit amet consectetur, adipisicing elit. Perferendis error exercitationem blanditiis mollitia consequuntur ex saepe expedita aperiam, cum corporis? Qui laboriosam iusto suscipit tempora ullam fugit,
            exercitationem quia eligendi ex nam officia commodi eos quisquam aperiam aliquam sequi neque.
          </p>
          <button className="mt-3 rounded-xl bg-primary px-5 py-2 text-[10px] font-bold text-black lg:px-14 lg:py-2 lg:text-[14px] ">Get Started</button>
        </div>
      </div>
    </div>
  );
}

export default Programming;
